import React from 'react';

const Add = () => {
  return (
    <div className="mngr-add-info-cont" dir="rtl">
      <div className="mngr-add-info" dir="rtl">
        <div className="mngr-add-info-icon"dir="rtl">
        <span class="material-icons" style={{fontSize:80, color:'white'}} >add</span>
        </div>
      </div>
    </div>
  );
}

export default Add;
